import React, { useState, useEffect } from 'react';
import { Divider, ListItem, Drawer, ListItemIcon, ListItemText, Toolbar } from '@mui/material';

type NavListItemProps = {
    icon?: React.ReactElement;
    text?: string;
    onClickCommand?: () => void;
    children?: React.ReactNode;
};
export default function NavListItem(props: NavListItemProps) {
    const { icon, text, onClickCommand, children } = props;

    return (
        <ListItem button  onClick={onClickCommand}>
                <ListItemIcon>
                    {children}
                </ListItemIcon>
                <ListItemText primary={text}/>
        </ListItem>
    );
}
